resource "azurerm_resource_group" "azure-db-rg" {
    name     = "{{group_name}}"
    location = "{{region}}"
}
resource "azurerm_mysql_server" "test" {
    name                = "{{server_name}}"
    location            = "{{region}}"
    resource_group_name = "${azurerm_resource_group.azure-db-rg.name}"
    sku {
    name = "B_Gen4_2"
    capacity = 2
    tier = "Basic"
    family = "Gen4"
    }
    storage_profile {
        storage_mb = 5120
    }
    administrator_login = "{{admin_username}}"
    administrator_login_password = "{{admin_password}}"
    version = "5.7"
    ssl_enforcement = "Enabled"
}
resource "azurerm_mysql_database" "test" {
    name                = "{{db_name}}"
    resource_group_name = "${azurerm_resource_group.azure-db-rg.name}"
    server_name         = "${azurerm_mysql_server.test.name}"
    charset             = "utf8"
    collation           = "utf8_unicode_ci"
}

