resource "aws_iam_user" "ec2-user" {
  name = "ec2-user"
  path = "/"
}

resource "aws_iam_access_key" "ec2-key" {
  user = "${aws_iam_user.ec2-user.name}"
}

resource "aws_iam_user_policy" "ec2-policy" {
  name = "ec2-policy"
  user = "${aws_iam_user.ec2-user.name}"

  policy = <<EOF
{
  "Version": "2012-10-17",
  "Statement": [
    {
      "Action": [
        "ec2:Describe*"
      ],
      "Effect": "Allow",
      "Resource": "*"
    }
  ]
}
EOF
}

resource "aws_iam_group" "ec2-group" {
  name = "ec2-group"
  path = "/users/"
}

resource "aws_iam_group_policy" "ec2-policy" {
  name = "ec2-policy"
  group = "${aws_iam_group.ec2-group.name}"

  policy = <<EOF
{
  "Version": "2012-10-17",
  "Statement": [
    {
      "Action": [
        "ec2:Describe*"
      ],
      "Effect": "Allow",
      "Resource": "*"
    }
  ]
}
EOF
}

resource "aws_iam_group_membership" "group_members" {
    name = "group_members"
    users = [
        "ec2-user"
    ]
    group = "${aws_iam_group.ec2-group.name}"
}

resource "aws_iam_role" "role" {
    name = "stackaero-role"
    assume_role_policy = <<EOF
{
  "Version": "2012-10-17",
  "Statement": [
    {
      "Action": "sts:AssumeRole",
      "Principal": {
        "Service": "ec2.amazonaws.com"
      },
      "Effect": "Allow",
      "Sid": ""
    }
  ]
}
EOF
}

resource "aws_iam_role_policy" "role_policies" {
    name = "stackaero-role-policy"
    role = "${aws_iam_role.role.id}"

    policy = <<EOF
{
  "Version": "2012-10-17",
  "Statement": [
    {
      "Action": [
        "ec2:Describe*"
      ],
      "Effect": "Allow",
      "Resource": "*"
    }
  ]
}
EOF
}

resource "aws_s3_bucket" "aero_bucket" {
  bucket = "{{bucket_name}}"
  acl    = "private"

  tags {
    Name        = "{{bucket_name}}"
    Environment = "Dev"
  }
}

resource "aws_db_instance" "default" {
  allocated_storage    = {{disk_size}}
  storage_type         = "gp2"
  engine               = "mysql"
  engine_version       = "5.7"
  instance_class       = "{{instance_class}}"
  identifier           = "{{instance_identifier}}"
  name                 = "{{instance_name}}"
  username             = "{{db_username}}"
  skip_final_snapshot  = {{skip_final_snapshot}}
  password             = "{{db_password}}"
  parameter_group_name = "default.mysql5.7"
}
